import java.util.*;

public class FindAllAnagrams {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String p = "";
		String s = "yqrbgjdwtcaxzsnifvhmou";
		System.out.println(findAnagrams(p,s).toString());
	}

	// time limit exceeded
	public static List<Integer> findAnagrams(String s, String p) {
		List<Integer> indices = new LinkedList<>();
		char[] schars = s.toCharArray();
		char[] pchars = p.toCharArray();
		// to through every letter
		for (int i = 0; i < schars.length; i++) {
			int count = pchars.length;
			char[] ptemp = p.toCharArray();
			// slide the window right

			for (int j = i; j < pchars.length + i && j < schars.length; j++) {
				// check spot on window
				for (int k = 0; k < pchars.length; k++) {
					if (schars[j] == ptemp[k]) {
						count--;
						if (count == 0) {
							indices.add(i);
						}

						ptemp[k] = Character.MIN_VALUE;
						break;
					}
				}
			}
		}
		return indices;
	}
	
	//us hashmap
	

}
